import base64
import datetime
import tkinter as tk
import tkinter.filedialog as filedialog
from io import BytesIO
from tkinter import *
from tkinter import ttk


import PIL.Image
import PIL.ImageDraw
import PIL.ImageFile
from os import path
import os
import PIL.ImageFont
import webbrowser
import subprocess
import sys

def install(package):
    subprocess.check_call([sys.executable, "-m", "pip", "install", package])

PIL.ImageFile.LOAD_TRUNCATED_IMAGES = True

def generate_certificate():
    def save_profile():
        nonlocal name, dob, address, city, signature
        with open(r"certificate_quick.txt", "w+b") as g:
            if signature == "Déjà préchargée":
                signature = to_str[4]
            to_b64 = name + separator + dob + separator + address + separator + city + separator + signature
            to_b64 = base64.b64encode(to_b64.encode())
            g.write(to_b64)
        subprocess.check_call(["attrib", "+H", "certificate_quick.txt"])

    def tick(option):
        def draw_tick(x, y, offset):
            nonlocal draw
            draw.line((x, y, x + offset, y + offset), fill=(0, 0, 0), width=3)
            draw.line((x + offset, y, x, y + offset), fill=(0, 0, 0), width=3)

        line_x = 135
        line_offset = 36
        if option == "Vide":
            return
        elif option == "Travail":
            line_y = 1128
        elif option == "Courses":
            line_y = 1335
        elif option == "Santé":
            line_y = 1461
        elif option == "Familial":
            line_y = 1547
        elif option == "Sport":
            line_y = 1672
        draw_tick(line_x, line_y, line_offset)
    global window, to_str

    name = name_entry.get()
    dob = dob_entry.get()
    address = address_entry.get()
    city = city_entry.get()
    signature = signature_entry.get()
    choice = reason_dd.get()

    # current date
    c_date = datetime.datetime.now()
    date_format = str(c_date.day)+"/"+str(c_date.month)+"/"+str(c_date.year)
    # formated
    date_format = date_format.replace("/", "_")
    # File and image
    file_name = "attestation_"+date_format
    # Attestation.png base64
    im = b''
    # Creating new certificate
    img = PIL.Image.open(BytesIO(base64.b64decode(im))).convert("RGBA")
    sign = None
    draw = PIL.ImageDraw.Draw(img)
    arial = PIL.ImageFont.truetype("arial.ttf", 25)

    x_offset = 10
    y_offset = -15
    #username
    draw.text((362+x_offset, 607+y_offset), name, (0, 0, 0), font=arial)
    #user's date of birth
    draw.text((362+x_offset, 690+y_offset), dob, (0, 0, 0), font=arial)
    #user's location
    draw.text((369+x_offset, 782+y_offset), address, (0, 0, 0), font=arial)
    # Done at $location$
    draw.text((1030+x_offset, 1940+y_offset), city, (0, 0, 0), font=arial)
    # Done on the $c_date$
    draw.text((1318+x_offset, 1941+y_offset), str(c_date.day), (0, 0, 0), font=arial)
    draw.text((1388+x_offset, 1941+y_offset), str(c_date.month), (0, 0, 0), font=arial)

    tick(choice)

    if signature != "Déjà préchargée":
        sign = PIL.Image.open(signature)

    else:
        sign = PIL.Image.open(to_str[4])

    width, height = sign.size
    coef = 1
    if width > 570:
        coef = 570 / width
    if height * coef > 250:
        coef = 250 / height if coef > 250 / height else coef

    new_height = coef * height
    new_width = coef * width
    sign = sign.resize((round(new_width), round(new_height)))
    img.paste(sign, (955, 2052), mask=sign)
    rgb = PIL.Image.new('RGB', img.size, (255, 255, 255))
    rgb.paste(img, mask=img.split()[3])
    rgb.save(file_name+".pdf", 'PDF', resoultion=100.0)
    rgb.save(file_name + ".pdf", "pdf")
    if signature != "Déjà préchargée" or to_str[0] != name:
        os.remove(r"certificate_quick.txt")
        save_profile()
    window.destroy()

    webbrowser.open_new(file_name+".pdf")

def clr_path():
    path = tk.filedialog.askopenfilename()
    signature_entry.delete(0, tk.END)  # Remove current text in entry
    signature_entry.insert(0, path)  # Insert the 'path'

def set_text(e, text):
    e.delete(0, END)
    e.insert(0, text)
    return


if __name__ == "__main__":
    install("pillow")
    separator = r"""\[B:^4Q<,E?L:wc(&x)m:e:'NT}MN>z+eWEyr*U%;#AD]]Pmr'=JuA"-z~)5a"#35r83UAWNYE#pT"Y;J6Xz3uq:Uu}nkpnUX"B="""
    if path.exists("certificate_quick.txt"):
        to_str = None
        with open("certificate_quick.txt", "r") as f:
            to_str = f.read()
        to_str = base64.b64decode(to_str).decode("utf-8")
        to_str = to_str.split(separator)

    window = Tk()
    window.title("Attestation de déplacement")
    window.geometry("520x280")
    window.resizable(False, False)

    choices = ['Vide', 'Travail', 'Courses', 'Santé', 'Familial', 'Sport']

    name_label = tk.Label(window, text="Nom", width=20, anchor='e')
    name_entry = tk.Entry(window, text="", width=40)
    dob_label = tk.Label(window, text="Année de naissance", width=20, anchor='e')
    dob_entry = tk.Entry(window, text="", width=40)
    address_label = tk.Label(window, text="Adresse", width=20, anchor='e')
    address_entry = tk.Entry(window, text="", width=40)

    city_label = tk.Label(window, text="Ville", width=10, anchor='e')
    city_entry = tk.Entry(window, text="", width=40)
    reason_label = tk.Label(window, text="Raison", width=10, anchor='e')
    reason_dd = ttk.Combobox(window, justify='center', values=choices, state="readonly")
    reason_dd.option_add('*TCombobox*Listbox.Justify', 'center')
    reason_dd.current(0)
    signature_path = tk.Label(window, text="Signature", width=20, anchor='e')
    signature_entry = tk.Entry(window, text="", width=40)
    signature_browse = tk.Button(window, text="Ouvrir", width=10, command=clr_path)
    exec_button = tk.Button(window,
                            text='Générer',
                            command=generate_certificate)

    name_label.grid(row=0, column=0, sticky="nsew", padx=5, pady=5)
    name_entry.grid(row=0, column=1, sticky="nsew", padx=10, pady=5)
    dob_label.grid(row=1, column=0, sticky="nsew", padx=5, pady=5)
    dob_entry.grid(row=1, column=1, sticky="nsew", padx=10, pady=5)
    address_label.grid(row=2, column=0, sticky="nsew", padx=5, pady=5)
    address_entry.grid(row=2, column=1, sticky="nsew", padx=10, pady=5)
    city_label.grid(row=3, column=0, sticky="nsew", padx=5, pady=5)
    city_entry.grid(row=3, column=1, sticky="nsew", padx=10, pady=5)
    reason_label.grid(row=4, column=0, sticky="nsew", padx=10, pady=5)
    reason_dd.grid(row=4, column=1, sticky="nsew", padx=10, pady=5)
    signature_path.grid(row=5, column=0, sticky="nsew", padx=5, pady=5)
    signature_entry.grid(row=5, column=1, sticky="nsew", padx=10, pady=5)
    signature_browse.grid(row=5, column=2, sticky="nsew", padx=5, pady=5)
    exec_button.grid(row=6, column=1, sticky="nsew", padx=30, pady=20)

    if path.exists("certificate_quick.txt"):
        set_text(name_entry, to_str[0])
        set_text(dob_entry, to_str[1])
        set_text(address_entry, to_str[2])
        set_text(city_entry, to_str[3])
        set_text(signature_entry, "Déjà préchargée")

    window.mainloop()
